import React, { Fragment } from 'react'
import { connect } from 'react-redux'
import { login } from '../Actions/Auth'

function Homes({isAuthenticated}) {

    const guestdata = () => (
        <p> this is a para</p>
    )

    const authdata = () => {
        <Fragment>
            <p> this is a auth data</p>
        </Fragment>

    }

    return (
        <Fragment>
                 {isAuthenticated ? authdata:guestdata} 
        </Fragment>

    )
}

const mapStateToProps = state => ({
    isAuthenticated : state.auth.isAuthenticated
})

export default connect(mapStateToProps,{login})(Homes);
